// src/components/Header.js
import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <header className="header">
      <h1>Music Streaming App</h1>
      <nav>
        <Link to="/">Home</Link>
        <Link to="/playlists">Playlists</Link>
      </nav>
    </header>
  );
};

export default Header;
